import { Fragment } from "react";
import "../UserProfile/UserProfile.css"
import { logOut } from "../../services/userProfile-services";

const UserProfile = () => {
    return(<div className="prof">
            <h1>
            UserProfile
            </h1>
            <button onClick={logOut}>
                logOut
            </button>
        </div>);
};

export default UserProfile;
